Спрей специально разработан для защиты от укусов кровососущих насекомых на открытом воздухе в условиях дикой природы, обладает максимально мощным отпугивающим эффектом и обеспечивает максимально длительную защиту от комаров, клещей, москитов, мошек, мокрецов и слепней.
